import { SET_BOOKING_PENDING_VIEW, SET_BOOKING_UPCOMING_VIEW, SET_BOOKING_PAST_VIEW } from "../actions/types";

const initialState = {
    view: 'pending'
};

export default function(state = initialState, action) {
  switch (action.type) {
        case SET_BOOKING_PENDING_VIEW:
        return {
            ...state,
            view: 'pending'
        }
        case SET_BOOKING_UPCOMING_VIEW:
        return {
            view: 'upcoming'
        }
        case SET_BOOKING_PAST_VIEW:
        return {
            view: 'past'
        }
    default:
      return state;
  }
}
